 function consultaDadosPaiFilho(fields){
   log.info('Consulta Dados Pai X Filho');
   var nrProcesso = getValue("WKNumProces");
   var cardData   = hAPI.getCardData(nrProcesso);
   var it         = cardData.keySet().iterator();
   var listaFilho = new Array();
   var fieldTemp  = fields[0];

   while (it.hasNext()) {
     var key = it.next();
     var campo = key.split("___");

     if (key.indexOf('___') >= 0 && campo[0] == fieldTemp) {
       var idx = campo[1];
       var row = new Object();

       for(var i=0; i<fields.length; i++){
         var name = fields[i] + "___" + idx;
         row[fields[i]] = {value:hAPI.getCardValue(name), idx:idx, name:name};
       }
       listaFilho.push(row);
     }
   }
   return listaFilho;
 }

 function semCaractere(valor, c){
 	while(valor.indexOf(c) >= 0){
 		valor = valor.replace(c,'');
 	}
 	return valor;
 }

}

function intermediateconditional76() {

	var cchave = hAPI.getCardValue('cchave');

	var c1 = DatasetFactory.createConstraint('chave', cchave, cchave, ConstraintType.MUST );
	var cons = new Array(c1);

	var dsBaixa = DatasetFactory.getDataset('dsConsultaTitulo', null, cons, null);
	var sBaixa = false;
	if(dsBaixa.rowsCount){
		var dataBaixa = dsBaixa.getValue(0, 'data');
		if(dataBaixa.trim() != ""){
			hAPI.setCardValue('cDataBaixa', dataBaixa.trim());
			sBaixa = true;
		}
	}
	return sBaixa;



}
